def numDecodings(s):    """    :type s: str    :rtype: int    """    if len(s) == 0: return 0    slist = s.split("0")    print(slist)    if len(slist) == 0 or max([len(i) for i in slist]) == 0:        return 0    else:        for i in slist:            if len(i) > 0 and i != slist[-1]:                if i[-1] != "1" and i[-1] != "2":                    return 0    twoDigits = [str(i) for i in range(11, 20)]+[str(i) for i in range(21,27)]    print(twoDigits)    def decoding(s):        print(s)        if len(s) == 0:            return 1        for i in range(len(s)):            if i + 1 <= len(s) - 1 and s[i:i + 2] in twoDigits:                print(s[i:i+2])                return decoding(s[i + 1:]) + decoding(s[i + 2:])            else:                print(s[i+1:])                return decoding(s[i + 1:])    res = 1    for i in slist:        if i==slist[-1]:            res *= decoding(i)        else:            res*=decoding(i[:-1])    return res# print(numDecodings("10"))print(numDecodings("11"))